                <div className="col-12 text-center">
                    <h1>Welcome to MyApp</h1>
                    <p>This is the home page of your application. Feel free to explore the features available.</p>
                    <img 
                        src="https://images.pexels.com/photos/4406689/pexels-photo-4406689.jpeg?auto=compress&cs=tinysrgb&w=600" 
                        alt="Welcome Banner" 
                        className="img-fluid"
                    />
                </div>
            </div>
        </div>
    );
};

export default Home;
